import React from "react";
import { Link } from "react-router-dom";
import "../style.css"; 
import planetsGif from "../assets/planetsfor.gif";

const Planets = () => {
  return (
    <div className="planets-back">
      
      <img src={planetsGif} alt="Solar System" class = "planets"/>
      
      <map name="solarsystem">
        <area shape="circle" coords="200,185,40" href="/planets/mercury" alt="Mercury" />
        <area shape="circle" coords="270,185,40" href="/planets/venus" alt="Venus" />
        <area shape="circle" coords="300,195,40" href="/planets/earth" alt="Earth" />
        <area shape="circle" coords="400,180,50" href="/planets/mars" alt="Mars" />
        <area shape="circle" coords="425,180,50" href="/planets/jupiter" alt="Jupiter" />
        <area shape="circle" coords="520,180,50" href="/planets/saturn" alt="Saturn" />
        <area shape="circle" coords="610,180,50" href="/planets/uranus" alt="Uranus" />
        <area shape="circle" coords="690,180,50" href="/planets/neptune" alt="Neptune" />
        <area shape="circle" coords="770,180,50" href="/planets/pluto" alt="Pluto" />
      </map>
    </div>
  );
};

export default Planets;
